import React from 'react';
import PostItem from "./PostItem";

const PostList = ({ posts, title }) => {
    return (
        <div className='postList'>
            <h1 style={{ color: "#dcbffa", textAlign: "center" }}>
                {title}
            </h1>
            {posts.map((post) =>
                <PostItem pro={post} key={post.id} />
            )}
        </div>
    )
}

export default PostList;
